import React from "react";

export class HistoryMemes extends React.Component {
  constructor(meme) {
    super();
    this.state = {
      items: [],
      meme: meme,
    };
  }

  add() {
    this.state.items.push(this.state.meme);
    this.setState(this.state.items);
    console.log("memes history: ", this.state.items);
  }
}
